import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import Menubartemplate from "./template/Menubartemplate.js";
import { Button } from "primereact/button";
import { InputNumber } from "primereact/inputnumber";

function App() {
  const [data, setData] = useState(null);
  const [fibonacci, setFibonacci] = useState([]);
  const [number, setNumber] = useState();

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
    fetch("/fibonacci")
      .then((res) => res.json())
      .then((data) => {
        setFibonacci(data);
      });
  }, []);

  return (
    <div className="App">
      <Menubartemplate />

      <div className="p-formgroup-inline">
        <div className="p-field">
          <label htmlFor="firstname5" className="p-sr-only">
            Firstname
          </label>
          <InputText id="firstname5" type="text" placeholder="Firstname" />
        </div>
        <div className="p-field">
          <label htmlFor="lastname5" className="p-sr-only">
            Lastname
          </label>
          <InputText id="lastname5" type="text" placeholder="Lastname" />
        </div>
        <Button type="button" label="Submit" />
      </div>

      <div className="p-field p-col-12 p-md-3">
        <label htmlFor="integeronly">Integer Only</label>
        <InputNumber
          inputId="integeronly"
          value={number}
          onValueChange={(e) => setNumber(e.value)}
        />
      </div>
      <Button label="Click" icon="pi pi-check" />
    </div>
  );
}

export default App;
